import React from "react";
import "./Searcher.css"

class SideBar extends React.Component
{   
    state = 
    {
        IsOpened : this.props.IsOpened,
    }

    render()
    {
        return (
        <div className={this.state.IsOpened? "SideBar Open" : "SideBar"}>
            <div> I slide into view </div>
            <div> Me Too! </div>
            <div> Me Three! </div>
        </div>
        );
    }
}

export default SideBar;
